const initialState = {
  links: [
    {
      href: '/cs',
      name: 'Homepage',
      query: '',
    },
    {
      href: '/contact',
      name: 'Contact',
      query: '',
    },
  ],
}

const reducer = (state = initialState, action) => {
  switch (action.type) {
  case 'neco':
    return {
      ...state,
    }
  default:
    return state
  }
}

export default reducer
